import React from "react"
import classes from "./MEStyles.module.css"

export const ME = () => {
    return (
        <div className={classes.content}>
            <p>Baptême d'estique d'étole d'enfant d'chienne
                de saint-ciarge d'ostie de purée de saint-ciboire de bâtard
                de sapristi de calvinouche.
            </p>
        </div>
    )
}
